import { Component, Input, OnChanges } from '@angular/core';
import { FormGroup, FormBuilder } from '@angular/forms';

@Component({
  selector: 'app-paginator',
  templateUrl: './paginator.component.html',
  styleUrls: ['./paginator.component.scss']
})
export class PaginatorComponent implements OnChanges {

  @Input() page: number = 1;
  @Input() totalCount: number = 0;
  @Input() pageSizeOptions: number[] = [10, 25, 100];
  @Input() currentPageSizeOption: number;

  pageLinks: (string | number)[] = [];
  paginatorForm: FormGroup;

  constructor(private fb: FormBuilder) {
    this.currentPageSizeOption = this.pageSizeOptions[0];
    this.paginatorForm = this.fb.group({
      page: [this.page],
      pageSize: [this.currentPageSizeOption]
    });
  }

  createGroup(): FormGroup {
    return this.paginatorForm;
  }

  ngOnChanges(): void {
    this.pageLinks = this.getPageLinks();
  }

  getPageLinks(): (string | number)[] {
    var current = this.page,
        last = this.totalCount / this.currentPageSizeOption,
        delta = 2,
        left = current - delta,
        right = current + delta + 1,
        range = [],
        rangeWithDots = [],
        l;

    for (let i = 1; i <= last; i++) {
        if (i == 1 || i == last || i >= left && i < right) {
            range.push(i);
        }
    }

    for (let i of range) {
        if (l) {
            if (i - l === 2) {
                rangeWithDots.push(l + 1);
            } else if (i - l !== 1) {
                rangeWithDots.push('...');
            }
        }
        rangeWithDots.push(i);
        l = i;
    }

    return rangeWithDots;
  }

  setPage(page: any): void {
    if(page === '...') return;
    if(typeof page === 'string') page = parseInt(page);
    this.page = page;
    this.paginatorForm.patchValue({ page: this.page });
    this.pageLinks = this.getPageLinks();
  }

  nextPage(): void {
    if(this.page === (this.totalCount / this.currentPageSizeOption)) return;
    this.page++;
    this.paginatorForm.patchValue({ page: this.page });
    this.pageLinks = this.getPageLinks();
  }

  previousPage(): void {
    if(this.page === 1) return;
    this.page--;
    this.paginatorForm.patchValue({ page: this.page });
    this.pageLinks = this.getPageLinks();
  }

  changePageSize(pageSize: string): void {
    this.currentPageSizeOption = parseInt(pageSize);
    this.pageLinks = this.getPageLinks();
  }
}

