  }

  onSort(event: any) {
    this.sort = event.sorts[0];
    console.log('sort', this.sort);
    let tempData = this.payments.sort((a: any, b: any) => {
      if (this.sort.dir === 'asc') {
        return a[this.sort.prop] > b[this.sort.prop] ? 1 : -1;
        } else {
          return a[this.sort.prop] < b[this.sort.prop] ? 1 : -1;
        }
    });

    this.payments = [...tempData];
  }

  toggleStatus(event: MatCheckboxChange, uuid: string) {
    let index = this.payments.findIndex((item: PaymentEntity) => item.uuid === uuid);
    this.payments[index].status = event.checked;
    this.payments = [...this.payments];
  }
}

